      if (!status_ok(status)) {
        return ConvertApiErrorStatusForNiRFmxInstrHandle(context, status, 0);
      }
      response->set_status(status);
      convert_to_grpc(timestamp, response->mutable_timestamp());
      return ::grpc::Status::OK;
